import React from 'react';
import {SideBar, Content } from './container';
import { HashRouter } from 'react-router-dom';
import {MainHolder} from './container';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <HashRouter>
          <SideBar />
          <Content />
          <MainHolder/>
        </HashRouter>
    </div>
  );
}

export default App;
